import React from 'react';
import { Outlet } from 'react-router-dom';

const About = () => {
    return (
        <div>
            <h4>회사정보</h4>
                <img src='/img/info/imgi_52_visual_bg.jpg' alt='회사 정보 이미지' />
            <Outlet></Outlet>
        </div>
    );
};

export default About;
